import MyNav from "./components/MyNav";
import Slider from "./components/Slider";
import Home from "./pages/Home";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <MyNav />
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
      <Slider />
    </BrowserRouter>
  );
}
export default App;
